    <script type="application/json" id="b933ab35-110c-4a55-8c24-c381e9e5b570">
      {"acf006a2-3ccb-4ab5-9ad5-875adcd13c26":{"version":"3.5.1","title":"Bokeh Application","roots":[{"type":"object","name":"Tabs","id":"p1504","attributes":{"sizing_mode":"stretch_both","tabs":[{"type":"object","name":"TabPanel","id":"p1495","attributes":{"title":"Summary","child":{"type":"object","name":"Div","id":"p1494","attributes":{"styles":{"type":"map","entries":[["width","100%"],["height","100%"],["max-width","1920px"],["max-height","1080px"],["padding","12px"],["border","1px solid lightgray"],["box-shadow","inset 1px 0 8px 0 lightgray"],["overflow","auto"]]},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 58.17 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 128 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 236.97 s &lt;/li&gt;\n&lt;li&gt; disk-write time: 27.37 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 4.74 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:46209 &lt;/li&gt;\n          &lt;li&gt; Workers: 16 &lt;/li&gt;\n          &lt;li&gt; Threads: 16 &lt;/li&gt;\n          &lt;li&gt; Memory: 119.21 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2024.8.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2024.8.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport argparse\nimport glob\nimport os\nimport sys\nimport time\nimport warnings\n\nimport dask.dataframe as dd\nimport ml_dask as dml\nimport ml_sklearn as skl\nimport ml_xgboost as xgb\nfrom dask.distributed import Client, LocalCluster, performance_report\nfrom dask_ml.metrics import mean_squared_error\nfrom dask_ml.model_selection import train_test_split\nfrom dask_ml.preprocessing import Categorizer, OrdinalEncoder\n\nwarnings.filterwarnings(\"ignore\")\n\nsys.path.insert(\n    0,\n    os.path.abspath(\n        os.path.join(os.path.dirname(os.path.realpath(__file__)), os.pardir)\n    ),\n)\n\nfrom to_hdf5 import read_hdf5\n\n\ndef parse_args():\n    parser = argparse.ArgumentParser()\n    parser.add_argument(\n        \"--input_location\",\n        type=str,\n        help=\"The location of the input data file (parquet or hdf5).\",\n    )\n    parser.add_argument(\n        \"--data_format\",\n        type=str,\n        choices=[\"parquet\", \"h5\", \"duckdb\"],\n        help=\"The format of the input data file (parquet or hdf5).\",\n    )\n    parser.add_argument(\n        \"--ml_method\",\n        type=str,\n        choices=[\"dask\", \"xgb\", \"sklearn\"],\n        help=\"The method to use for ML.\",\n    )\n    return parser.parse_args()\n\n\ndef read_data(location, format):\n    if format in [\"duckdb\", \"parquet\"]:\n        data = dd.read_parquet(location)\n    elif format == \"h5\":\n        files = glob.glob(f\"{location}*.{format}\")\n        data = dd.concat([read_hdf5(file) for file in files])\n    return data\n\n\ndef chunk(s):\n    # for the comments, assume only a single grouping column, the\n    # implementation can handle multiple group columns.\n    #\n    # s is a grouped series. value_counts creates a multi-series like\n    # (group, value): count\n    return s.value_counts()\n\n\ndef agg(s):\n    # s is a grouped multi-index series. In .apply the full sub-df will passed\n    # multi-index and all. Group on the value level and sum the counts. The\n    # result of the lambda function is a series. Therefore, the result of the\n    # apply is a multi-index series like (group, value): count\n    return s.apply(lambda s: s.groupby(level=-1, sort=False).sum())\n\n    # # faster version using pandas internals\n    # s = s._selected_obj\n    # return s.groupby(level=list(range(s.index.nlevels))).sum()\n\n\ndef finalize(s):\n    # s is a multi-index series of the form (group, value): count. First\n    # manually group on the group part of the index. The lambda will receive a\n    # sub-series with multi index. Next, drop the group part from the index.\n    # Finally, determine the index with the maximum value, i.e., the mode.\n    level = list(range(s.index.nlevels - 1))\n    return (\n        s.groupby(level=level, sort=False)\n        # .apply(lambda s: s.reset_index(level=level, drop=True).argmax())\n        .apply(lambda s: s.reset_index(level=level, drop=True).idxmax())\n    )\n\n\nif __name__ == \"__main__\":\n    print(\"Getting Workers\")\n    cluster = LocalCluster(n_workers=16, processes=1, memory_limit=\"8GB\")\n    client = Client(cluster)\n\n    print(\"Reading Data\")\n    args = parse_args()\n    with performance_report(filename=f\"../../tasks/05/dask_ml_report_2_{args.data_format}_{args.ml_method}.html\"):\n        data = read_data(args.input_location, args.data_format)\n\n        mode = dd.Aggregation(\"mode\", chunk, agg, finalize)\n\n        tic = time.time()\n\n        print(\"Beggining Aggregation\")\n        daily_ddf = data.groupby(\"Issue Date\", sort=False).agg(\n            {\n                \"tempmax\": \"first\",\n                \"tempmin\": \"first\",\n                \"temp\": \"first\",\n                \"conditions\": \"first\",\n                \"humidity\": \"first\",\n                \"windspeed\": \"first\",\n                \"visibility\": \"first\",\n                \"Distance to CMS\": \"mean\",\n                \"Distance to CHS\": \"mean\",\n                \"Distance to CIL\": \"mean\",\n                \"Distance to CIS\": \"mean\",\n                \"Distance to CB\": \"mean\",\n            }\n        )\n\n        daily_ddf[\"count\"] = data.groupby(\"Issue Date\", sort=False).size()\n        daily_ddf = daily_ddf.dropna()\n\n        daily_mode_ddf = data.groupby(\"Issue Date\", sort=False).agg(\n            {\n                \"Registration State\": mode,\n                \"Plate Type\": mode,\n                \"Violation Code\": mode,\n                \"Vehicle Body Type\": mode,\n                \"Vehicle Make\": mode,\n                \"Issuing Agency\": mode,\n                \"Violation County\": mode,\n            }\n        )\n\n        data = daily_ddf.merge(daily_mode_ddf, on=\"Issue Date\")\n\n        del daily_ddf, daily_mode_ddf\n\n        print(\"Start of Categorizer\")\n        ce = Categorizer(\n            columns=[\n                \"conditions\",\n                \"Registration State\",\n                \"Plate Type\",\n                \"Violation Code\",\n                \"Vehicle Body Type\",\n                \"Vehicle Make\",\n                \"Issuing Agency\",\n                \"Violation County\",\n            ]\n        )\n        data = ce.fit_transform(data)\n\n        enc = OrdinalEncoder(\n            columns=[\n                \"conditions\",\n                \"Registration State\",\n                \"Plate Type\",\n                \"Violation Code\",\n                \"Vehicle Body Type\",\n                \"Vehicle Make\",\n                \"Issuing Agency\",\n                \"Violation County\",\n            ]\n        )\n        data = enc.fit_transform(data)\n\n        data = data.persist()\n\n        print(\"Splitting Data\")\n        X, y = data.drop(columns=[\"Distance to CHS\"]), data[\"Distance to CHS\"]\n        X_train, X_test, y_train, y_test = train_test_split(\n            X, y, test_size=0.2, shuffle=True, random_state=42\n        )\n        X_train_, y_train_ = X_train.values.persist(), y_train.values.persist()\n        X_test_, y_test_ = X_test.values.persist(), y_test.values.persist()\n\n        X_train_.compute_chunk_sizes(), y_train_.compute_chunk_sizes(), X_test_.compute_chunk_sizes(), y_test_.compute_chunk_sizes()\n\n        print(\"Performing ML\")\n        if args.ml_method == \"dask\":\n            preds = dml.make_fit_predict(X_train_, y_train_, X_test_)\n        elif args.ml_method == \"xgb\":\n            preds = xgb.make_fit_predict(X_train_, y_train_, X_test_)\n        elif args.ml_method == \"sklearn\":\n            preds = skl.make_fit_predict(X_train_, y_train_, X_test_)\n\n    print(f\"Dask ML MSE: {mean_squared_error(y_test_, preds, squared=False):.6f}\")\n    print(f\"Dask ML Time: {time.time() - tic:.2f}s\")\n    client.close()\n\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p1499","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p1141","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p1139","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p1140","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p1151"},"y_scale":{"type":"object","name":"LinearScale","id":"p1152"},"title":{"type":"object","name":"Title","id":"p1144","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p1181","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p1136","attributes":{"selected":{"type":"object","name":"Selection","id":"p1137","attributes":{"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p1138"},"data":{"type":"map","entries":[["start",[1724029943308.4746,1724029944296.379,1724029943692.8765,1724029945059.9727,1724029943815.117,1724029945324.7073,1724029944038.167,1724029945780.6462,1724029944191.1265,1724029944277.6755,1724029946076.2996,1724029946245.8518,1724029944462.9805,1724029946633.1326,1724029944697.734,1724029946864.914,1724029946946.8533,1724029947081.2407,1724029944765.3708,1724029945746.0852,1724029947165.771,1724029944891.6902,1724029947296.5088,1724029947541.6157,1724029945105.6948,1724029947803.8997,1724029947949.2039,1724029948120.1692,1724029948124.835,1724029948137.3674,1724029948147.8984,1724029948155.
